import './App.css';

import {Box, Button} from '@mui/material'

const buttonStyle = {
  backgroundColor: "grey",
}

const App = () => {
  return (
    <div className="App">
      <Box display="flex" justifyContent="center" alignItems="center"  mt={10}>
        <Box display="flex">
          <Button variant="contained" style={buttonStyle}>
          use SHA256
          </Button>
        </Box>
        <Box display="flex">
          <Button variant="contained" style={buttonStyle}>
          use STREEBOG
          </Button>
        </Box>
      </Box>
    </div>
  );
}

export default App;
